import styled from "@emotion/styled";

export const Container = styled.div`
  max-width: 360px;
  min-height: 60px;
`;
export const Logo = styled.img`
  width: 38.11px;
  height: 26px;
`;
export const Title = styled.h1``;
export const ButtonAnchor = styled.a``;
